-- drop database if exists `emensa`;
CREATE DATABASE IF NOT EXISTS `emensa`;

USE `emensa`;
drop user if exists 'webapp';
CREATE user 'webapp';
grant usage on *.* to 'webapp';
grant all privileges on `emensa`.* to 'webapp';

DROP TABLE IF EXISTS `MahlzeitenMBilderN`;
DROP TABLE IF EXISTS `MahlzeitenMDeklarationenN`;
DROP TABLE IF EXISTS `MahlzeitenMBestellungenN`;
DROP TABLE IF EXISTS `MahlzeitenMZutatenN`;
DROP TABLE IF EXISTS `FachbereicheMFHAngehoerigeN`;
DROP TABLE IF EXISTS `BenutzerMBenutzerN`;
DROP TABLE IF EXISTS `Preise`;
DROP TABLE IF EXISTS `Kommentare`;
DROP TABLE IF EXISTS `Mahlzeiten`;
DROP TABLE IF EXISTS `Unterkategorien`;
DROP TABLE IF EXISTS `Kategorien`;
DROP TABLE IF EXISTS `Bestellungen`;
DROP TABLE IF EXISTS `Studenten`;
DROP TABLE IF EXISTS `Mitarbeiter`;
DROP TABLE IF EXISTS `FHAngehoerige`;
DROP TABLE IF EXISTS `Gaeste`;
DROP TABLE IF EXISTS `Bilder`;
DROP TABLE IF EXISTS `Fachbereiche`;
DROP TABLE IF EXISTS `Deklarationen`;
DROP TABLE IF EXISTS `Zutaten`;
DROP TABLE IF EXISTS `Benutzer`;

-- Neuerstellung aller noch nicht existierenden Tabellen

CREATE TABLE IF NOT EXISTS `Benutzer`
(
	`Nummer`        INT           PRIMARY KEY AUTO_INCREMENT,
	`Vorname`       VARCHAR(100)  NOT NULL,
	`Nachname`      VARCHAR(100)  NOT NULL,
	`Nutzername`    VARCHAR(100)  NOT NULL UNIQUE,
	`EMail`         VARCHAR(255)  NOT NULL UNIQUE,
	`Letzter_Login` TIMESTAMP     DEFAULT '1970-01-01 01:00:01' ON UPDATE current_TIMESTAMP,
	`Anlegedatum`   DATE          NOT NULL,
	`Aktiv`         BOOL          NOT NULL DEFAULT FALSE,
	`Geburtsdatum`  DATE,
	`Alter`         TINYINT,
	`Hash`          CHAR(24)      NOT NULL DEFAULT '000000000000000000000000',
	`Salt`          CHAR(32)      NOT NULL DEFAULT '00000000000000000000000000000000'
);

CREATE TABLE IF NOT EXISTS `Zutaten`
(
	`ID`            INT           PRIMARY KEY,
	`Name`          VARCHAR(100)  NOT NULL,
	`Bio`           BOOL          NOT NULL DEFAULT FALSE,
	`Vegetarisch`   BOOL          NOT NULL DEFAULT FALSE,
	`Vegan`         BOOL          NOT NULL DEFAULT FALSE,
	`Glutenfrei`    BOOL          NOT NULL DEFAULT FALSE,
	-- CONSTRAINT `IDmin` CHECK (`ID` > 9999), | Nicht verwendbar, da Beispieldaten eine Fehlermeldung auslösen würden
	CONSTRAINT      `IDmax`       CHECK (`ID` < 100000)
);

CREATE TABLE IF NOT EXISTS `Deklarationen`
(
	`Zeichen`       VARCHAR(2)    PRIMARY KEY,
	`Beschriftung`  VARCHAR(32)   NOT NULL
);

CREATE TABLE IF NOT EXISTS `Fachbereiche`
(
	`ID`          INT primary     KEY AUTO_INCREMENT,
	`Name`        VARCHAR(50)     NOT NULL,
	`Website`     VARCHAR(255)    NOT NULL
);

CREATE TABLE IF NOT EXISTS `Bilder`
(
	`ID`          INT             PRIMARY KEY AUTO_INCREMENT,
	`AltText`     VARCHAR(255)    NOT NULL,
	`Titel`       VARCHAR(255),
	`Binaerdaten` mediumblob      NOT NULL
);

CREATE TABLE IF NOT EXISTS `Gaeste`
(
	`ID` INT PRIMARY KEY,
	`Grund` VARCHAR(255) NOT NULL,
	`Ablaufdatum` date NOT NULL,
	CONSTRAINT `Gaeste ISA Benutzer` FOREIGN KEY (`ID`) REFERENCES `Benutzer`(`Nummer`) ON DELETE CASCADE
);

CREATE TABLE IF NOT EXISTS FHAngehoerige
(
	`ID` INT PRIMARY KEY,
	CONSTRAINT `FHAngehoerige ISA Benutzer` FOREIGN KEY (`ID`) REFERENCES `Benutzer`(`Nummer`) ON DELETE CASCADE
);

CREATE TABLE IF NOT EXISTS `Mitarbeiter`
(
	`ID` INT PRIMARY KEY,
	`Telefon` INT,
	`Buero` VARCHAR(50),
	CONSTRAINT `Mitarbeiter -ODER-> ID` FOREIGN KEY (`ID`) REFERENCES `FHAngehoerige`(`ID`) ON DELETE CASCADE
);

CREATE TABLE IF NOT EXISTS `Studenten`
(
	`ID` INT PRIMARY KEY,
	`Studiengang` ENUM('ET','INF','ISE','MCD','WI') NOT NULL,
	`Matrikelnummer` INT UNIQUE NOT NULL,
	CONSTRAINT `MatrikelMin` CHECK (`Matrikelnummer` > 9999999),
	CONSTRAINT `MatrikelMax` CHECK (`Matrikelnummer` < 1000000000),
	CONSTRAINT `Student -ODER-> ID` FOREIGN KEY (`ID`) REFERENCES `Benutzer`(`Nummer`) ON DELETE CASCADE
);

CREATE TABLE IF NOT EXISTS `Bestellungen`
(
	`Nummer` INT PRIMARY KEY AUTO_INCREMENT,
	`Bestellzeitpunkt` TIMESTAMP NOT NULL,
	`Abholzeitpunkt` TIMESTAMP,
	`BenutzerNummer` INT,
	`Endpreis` DECIMAL(6,2),
	CONSTRAINT `AbholzeitpunktD > BestellzeitpunktD` CHECK (Datediff(`Abholzeitpunkt`,`Bestellzeitpunkt`) >= 0),
	CONSTRAINT `AbholzeitpunktT > BestellzeitpunktT` CHECK (Timediff(`Abholzeitpunkt`,`Bestellzeitpunkt`) > 0),
	CONSTRAINT `Benutzer1-BestellungenN` FOREIGN KEY (`BenutzerNummer`) REFERENCES `Benutzer`(`Nummer`)
);

CREATE TABLE IF NOT EXISTS `Kategorien`
(
	`ID` INT PRIMARY KEY AUTO_INCREMENT,
	`Bezeichnung` VARCHAR(255) NOT NULL,
	`Bild` INT,
	CONSTRAINT `Bild1-KategorienN` FOREIGN KEY(`Bild`) REFERENCES `Bilder`(`ID`)
);

CREATE TABLE IF NOT EXISTS `Unterkategorien`
(
	`ID` INT,
	`UnterkategorieID` INT,
	PRIMARY KEY (`ID`,`UnterkategorieID`),
	CONSTRAINT `Kategorie` FOREIGN KEY(`ID`) REFERENCES `Kategorien`(`ID`),
	CONSTRAINT `Unterkategorie` FOREIGN KEY(`UnterkategorieID`) REFERENCES `Kategorien`(`ID`)
);

CREATE TABLE IF NOT EXISTS `Mahlzeiten`
(
	`ID` INT PRIMARY KEY AUTO_INCREMENT,
	`Beschreibung` VARCHAR(255) NOT NULL,
	`Vorrat` SMALLINT NOT NULL DEFAULT 0,
	`KategorienID` INT,
	`Verfuegbar` BOOL,
	CONSTRAINT `Kategorien1-MahlzeitenN` FOREIGN KEY(`KategorienID`) REFERENCES `Kategorien`(`ID`),
	CONSTRAINT `Vorratscheck` CHECK (`Vorrat` >= 0)
);

CREATE TABLE IF NOT EXISTS `Kommentare`
(
	`ID` INT PRIMARY KEY AUTO_INCREMENT,
	`Bemerkung` VARCHAR(255),
	`Bewertung` ENUM('1','2','3','4','5') NOT NULL,
	`StudentenID` INT,
	`MahlzeitenID` INT,
	CONSTRAINT `Studenten1-KommentareN` FOREIGN KEY (`StudentenID`) REFERENCES `Studenten`(`ID`),
	CONSTRAINT `Mahlzeiten1-KommentareN` FOREIGN KEY (`MahlzeitenID`) REFERENCES `Mahlzeiten`(`ID`)
);

CREATE TABLE IF NOT EXISTS `Preise`
(
	`Jahr` YEAR NOT NULL,
	`MahlzeitenID` INT,
	`Gastpreis` DECIMAL(4,2) NOT NULL,
	`Studentpreis` DECIMAL(4,2),
	`MAPreis` DECIMAL(4,2),
	CONSTRAINT `Mahlzeiten-Preise` FOREIGN KEY (`MahlzeitenID`) REFERENCES `Mahlzeiten`(`ID`) ON DELETE CASCADE,
	CONSTRAINT `Preischeck` CHECK (`Studentpreis` < `MAPreis`),
	PRIMARY KEY(`Jahr`,`MahlzeitenID`)
);

CREATE TABLE IF NOT EXISTS `MahlzeitenMBilderN`
(
	`MahlzeitenID` INT,
	`BildID` INT,
	CONSTRAINT `Mahlzeiten-Bild` FOREIGN KEY (`MahlzeitenID`) REFERENCES `Mahlzeiten`(`ID`),
	CONSTRAINT `Bild-Mahlzeiten` FOREIGN KEY (`BildID`) REFERENCES `Bilder`(`ID`),
	PRIMARY KEY (`MahlzeitenID`,`BildID`)
);

CREATE TABLE IF NOT EXISTS `MahlzeitenMDeklarationenN`
(
	`MahlzeitenID` INT,
	`Deklaration` VARCHAR(2),
	CONSTRAINT `Mahlzeiten-Deklarationen` FOREIGN KEY (`MahlzeitenID`) REFERENCES `Mahlzeiten`(`ID`),
	CONSTRAINT `Deklarationen-Mahlzeiten` FOREIGN KEY (`Deklaration`) REFERENCES `Deklarationen`(`Zeichen`),
	PRIMARY KEY (`MahlzeitenID`, `Deklaration`)
);

CREATE TABLE IF NOT EXISTS `MahlzeitenMZutatenN`
(
	`MahlzeitenID` INT,
	`ZutatenID` INT,
	CONSTRAINT `Mahlzeiten-Zutaten` FOREIGN KEY (`MahlzeitenID`) REFERENCES `Mahlzeiten`(`ID`),
	CONSTRAINT `Zutaten-Mahlzeiten` FOREIGN KEY (`ZutatenID`) REFERENCES `Zutaten`(`ID`),
	PRIMARY KEY (`MahlzeitenID`,`ZutatenID`)
);

CREATE TABLE IF NOT EXISTS `FachbereicheMFHAngehoerigeN`
(
	`FachbereicheID` INT,
	`FHAngehoerigeID` INT,
	CONSTRAINT `Fachbereiche-FHAngehoerige` FOREIGN KEY (`FachbereicheID`) REFERENCES `Fachbereiche`(`ID`),
	CONSTRAINT `FHAngehoerige-Fachbereiche` FOREIGN KEY (`FHAngehoerigeID`) REFERENCES `FHAngehoerige`(`ID`),
	PRIMARY KEY (`FachbereicheID`,`FHAngehoerigeID`)
);

CREATE TABLE IF NOT EXISTS `MahlzeitenMBestellungenN`
(
	`MahlzeitenID` INT,
	`BestellungsNummer` INT,
	`Anzahl` INT,
	CONSTRAINT `Mahlzeiten-Bestellungen` FOREIGN KEY (`MahlzeitenID`) REFERENCES `Mahlzeiten`(`ID`),
	CONSTRAINT `Bestellungen-Mahlzeiten` FOREIGN KEY (`BestellungsNummer`) REFERENCES `Bestellungen`(`Nummer`)
);

CREATE TABLE IF NOT EXISTS `BenutzerMBenutzerN`
(
	`BenutzerNummerM` INT,
	`BenutzerNummerN` INT,
	CONSTRAINT `BenutzerM-BenutzerN` FOREIGN KEY (`BenutzerNummerM`) REFERENCES `Benutzer`(`Nummer`),
	CONSTRAINT `BenutzerN-BenutzerM` FOREIGN KEY (`BenutzerNummerN`) REFERENCES `Benutzer`(`Nummer`),
	PRIMARY KEY(`BenutzerNummerM`,`BenutzerNummerN`)
);

