DROP PROCEDURE IF EXISTS Nutzerrolle;
DELIMITER $
CREATE PROCEDURE Nutzerrolle(IN ID INT, OUT Rolle CHAR(11))
 BEGIN
   IF (SELECT COUNT(ID) FROM Studenten WHERE Studenten.ID = ID) > 0 THEN
     SELECT 'Student' INTO Rolle;
   ELSEIF (SELECT COUNT(ID) FROM Mitarbeiter WHERE Mitarbeiter.ID = ID) > 0 THEN
    SELECT 'Mitarbeiter' INTO Rolle;
   ELSEIF (SELECT COUNT(ID) FROM Gaeste WHERE Gaeste.ID = ID) > 0 THEN
    SELECT 'Gast' INTO Rolle;
   ELSE
     SELECT NULL INTO Rolle;
   END IF;
 END;
$

DROP PROCEDURE IF EXISTS NutzerrolleOutput$
CREATE PROCEDURE NutzerrolleOutput(IN ID INT)
  BEGIN
    CALL Nutzerrolle(ID, @output);
    SELECT @output AS Rolle;
  END;
$

DROP PROCEDURE IF EXISTS Preis$

CREATE PROCEDURE Preis(IN BenutzerNummer INT, IN MahlzeitenID INT)
  BEGIN
    CALL Nutzerrolle(BenutzerNummer, @role);
    CASE @role
      WHEN 'Student' THEN SELECT Studentpreis AS Preis FROM Preise WHERE Preise.MahlzeitenID = MahlzeitenID;
      WHEN 'Mitarbeiter' THEN SELECT MAPreis AS Preis FROM Preise WHERE Preise.MahlzeitenID = MahlzeitenID;
      ELSE SELECT Gastpreis AS Preis FROM Preise WHERE Preise.MahlzeitenID = MahlzeitenID;
    END CASE;
  END;
$

DROP TRIGGER IF EXISTS Bestellung$
CREATE TRIGGER Bestellung
  AFTER INSERT ON MahlzeitenMBestellungenN FOR EACH ROW
  BEGIN
    UPDATE Mahlzeiten SET Mahlzeiten.Vorrat = Mahlzeiten.Vorrat - NEW.Anzahl
    WHERE Mahlzeiten.ID = NEW.MahlzeitenID;
    UPDATE Mahlzeiten SET Mahlzeiten.Verfuegbar = 0
    WHERE Mahlzeiten.Vorrat = 0;
  END;
$
DELIMITER ;

